import React from 'react'
import { StyleSheet, Text, View } from 'react-native';
import { ListItem, Avatar } from 'react-native-elements';

const CustomListItem = () => {
    return (
        <ListItem>
            <Avatar rounded source={{ uri: "https://ampelou.s3.amazonaws.com/default.png",}} containerStyle={styles.avatar} />
            <ListItem.Content>
                <ListItem.Title style={{fontWeight:"800"}}>
                    Youtube Chat
                </ListItem.Title>
                <ListItem.Subtitle numberOfLines={1} ellipsizeMode="tail">
                    Hey What's Up Guys This Is A Subtitle.Hey What's Up Guys This Is A Subtitle.Hey What's Up Guys This Is A Subtitle.
                </ListItem.Subtitle>
            </ListItem.Content>
        </ListItem>
    );
}; 

export default CustomListItem

const styles = StyleSheet.create({
    avatar :{
        resizeMode: 'cover',
    }
})
